INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("", 91002, 0, 0, 0, 1, 8, 100, 40000, "", 36);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 91002, 107501, 1, 0, 1, 8, 150, 40001, "ぺコリーヌ", 37);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 91002, 107601, 1, 0, 2, 8, 150, 40001, "コッコロ", 38);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 91002, 107801, 1, 0, 3, 8, 150, 40001, "キャル", 39);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 91002, 107701, 1, 0, 4, 8, 150, 40001, "スズメ", 40);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 91002, 107901, 1, 0, 5, 8, 150, 40001, "タマキ", 41);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 91002, 107501, 2, 0, 6, 8, 150, 40001, "ぺコリーヌ", 42);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 91002, 107601, 2, 0, 7, 8, 150, 40001, "コッコロ", 43);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 91002, 107801, 2, 0, 8, 8, 150, 40001, "キャル", 44);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 91002, 107701, 2, 0, 9, 8, 150, 40001, "スズメ", 45);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 91002, 107901, 2, 0, 10, 8, 150, 40001, "タマキ", 46);
