INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 125801, 1, 0, 1, 2, 1, 40011, "リリ", 321);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 126001, 1, 0, 2, 2, 1, 40011, "クリア", 322);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("んーと。\nこれ、あげる。\nはい", 24001, 126101, 1, 0, 3, 2, 1, 40011, "プレシア", 323);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 125801, 2, 0, 4, 2, 1, 40011, "リリ", 324);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 126001, 2, 0, 5, 2, 1, 40011, "クリア", 325);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES ("お兄。\nきてくれて、うれしい", 24001, 126101, 2, 0, 6, 2, 1, 40011, "プレシア", 326);
